import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
import FitnessCenterIcon from '@mui/icons-material/FitnessCenter';
import { Link, useNavigate } from 'react-router-dom';
import { UserContext } from '../App';
import { useContext } from 'react';



export default function Navbar() {

  const {userName, setUserName} = useContext(UserContext)
  const {password, setPassword} = useContext(UserContext)
  const {loggedIn, setLoggedIn} = useContext(UserContext)

  const navigate = useNavigate();

  const logOut = () => {
    setLoggedIn(false)
    setUserName('')
    setPassword('')
  }


  return (
    <Box sx={{
                width: '100%' }}>
      <AppBar position="fixed">
        <Toolbar sx={{ backgroundColor: 'primary.main' }}>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            onClick={() => navigate('/')}>
              <FitnessCenterIcon />
            </IconButton>
            <Typography sx={{ flexGrow: 1, fontFamily: 'Shadows Into Light, cursive', 
            fontSize: '2em', cursor: 'default'}}>
              GYMBRO
            </Typography>
            <div className='navLinkContainer'>
              <div>
                <Link to={"/MyRoutines"} className='navLink'>MY ROUTINES</Link>
              </div>

              {!loggedIn &&
                <>
                  <div>
                    <Link to={"/Login"} className='navLink'>LOG IN</Link>
                  </div>
                  <div>
                    <Link to={"/SignUp"} className='navLink'>SIGN UP</Link>
                  </div>
                </>
              }

          {loggedIn &&
              <>
                <div>
                <Link to={"/LogIn"} className='navLink' onClick={logOut}>LOG OUT</Link>
                </div>
                <div>
                  <Typography>Hi, {userName}!</Typography>
                </div>

              </>}

              </div>
        </Toolbar>
      </AppBar>
    </Box>
  );
}
